VALUES ('3564884020518', 'Chocolat Noir Cœur Praliné', 'Chocolat noir 59 % (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de _soja_), Fourrage au praliné noisette 37 % [praliné noisette 9.6 % (_noisette_ 4.8 %, sucre), sucre, matières grasses végétales non hydrogénées (colza-karité-coprah), cacao maigre en poudre, _lait_ écrémé en poudre, émulsifiant : lécithine de _soja_, arôme vanilline], Brisures de spéculoos 4 % [farine de _blé_ (_gluten_), sucre, huile végétale (colza) sirop de candi, beurre (_lait_) concentré, poudre à lever : carbonate acide de sodium, sel, cannelle].', 'https://static.openfoodfacts.org/images/products/356/488/402/0518/front_fr.4.400.jpg', '34.6', '15.1', '49.6', '44.9', '', '6', '0.05', '0.0196850393700787', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3564884020525', 'Chocolat Blanc coeur caramel', 'CHOCOLAT BLANC 66% (sucre, beurre de cacao, poudre de lait entier, poudre de lait écrémé, émulsifiant : lécithine de soja, arôme naturel de vanille) ; FOURRAGE 31 % [caramel 84% (sucre, sirop de glucose, eau, crème fraîche (lait) d\'Isigny AOP 8%, lait entier en poudre, beurre (lait) salé d\'Isigny AOP 45%, fibres alimentaires, sel de Guérande IGP 0.6%, arôme naturel vanille), beurre de cacao, sucre, poudre de lait entier, poudre de lait écrémé, émulsifiant : lécithine de soja, arôme naturel de vanille, eau] ; ECLATS DE CARAMEL 3% (sucre, sirop de glucose, lait entier en poudre reconstitué, crème fraîche (lait) d\'Isigny AOP 996, beurre (lait) salé d\'Isigny AOP 3,6%, sel de Guérande IGP 1.2%, émulsifiant : lécithine de colza). Chocolat pur beurre de cacao. Traces de gluten et de fruits à coque.', 'https://static.openfoodfacts.org/images/products/356/488/402/0525/front_fr.8.400.jpg', '29.3', '17.8', '55.4', '48.7', '', '6.5', '0.41', '0.161417322834646', '', '0');

